import React from "react";
import { View, Text, StyleSheet } from "react-native";

function BoxScreen() {
  return (
    <View>
      <Text>Screen</Text>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    borderWidth: 1,
    borderColor: "blue",
  },
});

export default BoxScreen;
